import React from 'react';

function MyComponent({ items }) {
  return (
    <div className="container">
	    <div className="row">
	      {items.map((item, index) => (
	        <div className="col">
	          {/* Access the 'item' data */}
	      		<p>{item.name}</p>
	      		<p>{item.description}</p>
	      		{/* Access the current index */}
	      		<p>Index: {index}</p>
	        </div>
	      ))}
	    </div>
    </div>
  );
}

export default MyComponent;
